import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from 'react-bootstrap/Button'
import 'bootstrap/dist/css/bootstrap.min.css';
import './Mypage.scss'


function App() {
  return (
    <div class="buttonss">
    <Button class="button1" variant="outline-primary">Primary</Button>
    <Button class="button2" variant="outline-primary">Primary</Button>
    </div>
  );
}

export default App;
